INSERT INTO `pages` (`pageId`, `userId`, `parentId`, `role`, `pageName`, `pageUrl`, `visibility`, `createdDate`, `publishDate`, `modifiedDate`, `archivedDate`, `pageOrder`, `pageType`, `pageText`, `keyWords`, `showSlider`, `showInHomeWidget`) VALUES
(1, 5, 0, 'guest', 'Home', 'home', 'public', 2012, 0, 1362529130, 0, 1, 'home', '<table border="0" cellpadding="0" cellspacing="0" style="width: 800px; height: 188px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<div class="grid">\r\n					<h3>\r\n						<u>Liturgy Schedule</u></h3>\r\n					<p>\r\n						Saturday 5:00 pm</p>\r\n					<p>\r\n						Sunday 8:00 am and 10:30 am.</p>\r\n					<p>\r\n						Daily 8:00 am Holy Days 8:00 am and 7:00 pm</p>\r\n					<p>\r\n						Confessions: Saturday 4:00 pm or anytime upon request.</p>\r\n				</div>\r\n			</td>\r\n			<td>\r\n				<div class="grid">\r\n					<h3>\r\n						<u>Our Leadership</u></h3>\r\n					<p>\r\n						Chorbishop Richard D. Saad Pastor</p>\r\n					<p>\r\n						Rev. Mr. Samuel J. Wehby Deacon</p>\r\n				</div>\r\n			</td>\r\n			<td>\r\n				<div class="grid">\r\n					<h3>\r\n						<a href="http://stelias.dirextion.net/calendar">This Month&#39;s Calendar</a></h3>\r\n					<p>\r\n						Browse the events from our calendar to see what is happening this month at St. Elias Maronite Church.</p>\r\n				</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<hr />\r\n<h4>\r\n	About St. Elias Maronite Church</h4>\r\n<p>\r\n	St. Elias Maronite Church is located in Birmingham, Alabama. The church belongs to the Maronite Rite, which evolved from the Antiochene Tradition of Catholicism. The patron saint of our church is St. Elias (or Elijah, the Old-Testament prophet). St. Elias is depicted in the stained glass window behind our altar.</p>\r\n<p>\r\n	The &quot;MARONITE RITE&quot; takes its name from a holy hermit called MARON, who lived in the 4th and 5th centuries near Antioch, in Northern Syria. He was a staunch defender of the Catholic faith. His disciples followed in his footsteps. It has been said that their history &quot;is the story of a people who were continually willing to shed their blood and sacrifice their lives and possessions for religious convictions and human liberties.&quot;</p>\r\n<p>\r\n	The Maronite Church became a formal entity with the institution of the Maronite Patriarchate of Antioch and the Whole East, in the 7th century. The first Patriarch was St. John Maron, chosen in 685 A. D. The residence of the Maronite Patriarch is now in Lebanon.</p>\r\n', ' Testing, Extra,Keywords', 1, 0);
