(83, 1, 0, 'guest', 'History', 'history', 'public', 1358189433, NULL, 1362065280, NULL, 2, 'home', '<p>\r\n	St. Elias Catholic Church is located in Birmingham, Alabama. The church belongs to the Maronite Rite, which evolved from the Antiochene Tradition of Catholicism. The patron saint of our church is St. Elias (or Elijah, the Old-Testament prophet). The picture above, left, depicts Elijah as he was putting to death the prophets of Baal as described in 1 Kings 18. The picture above, right, depicts Elias as the &quot;prophet of Mt. Carmel&quot; with scroll, fiery sword and mantle. The two views together present St. Elias as described in 1 Kings 19:14 &quot;I have been most zealous for the Lord, the God of Hosts.&quot;</p>\r\n<p class="history">\r\n	<b>1910:</b> St. Elias Parish established. Building between 20th and 21st Streets and 6th Ave. South purchased and converted to a Catholic Church. First baptism on Jan. 20. Rev. Mobaarek Bellama, first pastor.</p>\r\n<p class="history">\r\n	<b>1911: </b> First Wedding, October 4 between Ayoub Wakeol and Deeby Assy.</p>\r\n<p class="history">\r\n	<b>1914: </b> Church dedication on Feb. 14 in honor of St. Elias</p>\r\n<p class="history">\r\n	<b>1917: </b> Rev. Joseph Koury named second pastor of St. Elias.</p>\r\n<p class="history">\r\n	<b>1920: </b> Rev. George Aziz named third pastor.</p>\r\n<p class="history">\r\n	<b>1939: </b> St. Elias closed temporarily.</p>\r\n<p class="history">\r\n	<b>1940: </b> St. Elias re-opened; Rev. Joseph Abi-Chedid becomes 10th pastor.</p>\r\n<p class="history">\r\n	<b>1945: </b> Land purchased at 8th Street and 9th Street South for new church.</p>\r\n<p class="history">\r\n	<b>1950: </b> First Divine Liturgy in new church --midnight, Christmas Eve</p>\r\n<p class="history">\r\n	First Baptism in new church -- December 31</p>\r\n<p class="history">\r\n	<b>1951: </b> First Wedding in new church -- March 25</p>\r\n<p class="history">\r\n	First Holy Communion in new church -- May 27</p>\r\n<p class="history">\r\n	<b>1959: </b> Church Hall built</p>\r\n<p class="history">\r\n	<b>1960: </b> Church Dedication and Golden Jubilee; Father Abi-Chedid elevated to Chor-Bishop</p>\r\n<p class="history">\r\n	<b>1962: </b> Parish Rectory built</p>\r\n<p class="history">\r\n	<b>1969: </b> Four Schoolrooms built; Chor-Bishop Abi-Chedid retires</p>\r\n<p class="history">\r\n	<b>1972: </b> St. Elias hosts Ninth Annual NAM Convention in Birmingham</p>\r\n<p class="history">\r\n	<b>1985: </b> Diamond Jubilee Year; Rev. Richard Saad appointed 15th pastor.</p>\r\n<p class="history">\r\n	<b>1988: </b> July 5-8, Nesrallah Peter Sfeir, Maronite Patriarch visits St. Elias.</p>\r\n<p class="history">\r\n	<b>1991: </b> Rev. Richard Saad named Monsignor (Chaplain to the Pope)</p>\r\n<p class="history">\r\n	<b>1993: </b> St. Elias hosts 30th Annual NAM Convention in Birmingham</p>\r\n<p class="history">\r\n	<b>1996: </b> Completed Multipurpose Building/Schoolroom addition to Parish Hall.</p>\r\n<p class="history">\r\n	<b>1999: </b> First Lebanese Food and Cultural Festival held</p>\r\n<p class="history">\r\n	<b>2000: </b> St. Elias celebrates 90th anniversary of its founding and 50th year at present location; 2nd annual Food and Cultural Festival held.</p>\r\n', '', 0, 0),
(85, 4, 15, 'guest', 'Inspection', 'inspection', 'public', 1358189805, NULL, 1360360120, NULL, 9, 'page', '<h3>\r\n	<span style="color: rgb(255, 140, 0);">Inspections as Required by NFPA #25 Including:</span></h3>\r\n<ul>\r\n	<li>\r\n		Monthly Inspections</li>\r\n	<li>\r\n		Quarterly Inspections</li>\r\n	<li>\r\n		Semi-Annual Inspections</li>\r\n	<li>\r\n		Annual Inspections</li>\r\n	<li>\r\n		Anti-Freeze Systems</li>\r\n	<li>\r\n		Weekly Fire Pump Operational Test</li>\r\n	<li>\r\n		Annual Fire Pump Performance Test</li>\r\n	<li>\r\n		Backflow Prevention Device Testing</li>\r\n	<li>\r\n		Fire Extinguisher Inspection and Tagging</li>\r\n	<li>\r\n		Fire Hose Inspection and Tagging</li>\r\n	<li>\r\n		Standpipe and Fire Hose Valve Inspections</li>\r\n	<li>\r\n		Supervisory Alarm Testing</li>\r\n	<li>\r\n		Written Reports for Authority Having Juridiction</li>\r\n	<li>\r\n		&nbsp;Inspection Agreements</li>\r\n</ul>\r\n', '', 0, 0),
(86, 4, 15, 'guest', 'Service', 'service', 'public', 1358190397, NULL, 1360360069, NULL, 9, 'page', '<h3>\r\n	<span style="color: rgb(255, 140, 0);">Full Time Service including:</span></h3>\r\n<ul>\r\n	<li>\r\n		24 Hour Emergency Service</li>\r\n	<li>\r\n		Fire System Repairs</li>\r\n	<li>\r\n		Fire Pump Repairs</li>\r\n	<li>\r\n		Underground Repairs</li>\r\n	<li>\r\n		Fire Hydrant Repairs</li>\r\n	<li>\r\n		Tenant Improvements</li>\r\n	<li>\r\n		Fire Equipment</li>\r\n	<li>\r\n		Sales Estimates for Repair</li>\r\n	<li>\r\n		Service Agreements</li>\r\n</ul>\r\n', '', 0, 0),
