(95, 7, 15, 'guest', 'Downloads', 'downloads', 'public', 1362414832, NULL, 1364227834, NULL, 17, 'festival', '<p>\r\n	For access to our Facebook Page for St. Elias Food and Cultural Festival please <a href="http://www.facebook.com/pages/St-Elias-Food-and-Cultural-Festival/121961474655222">click here</a>.</p>\r\n<p>\r\n	To read and download the new press release please <a href="/press-release.DOC">click here</a>.</p>\r\n<p>\r\n	To read and download the flyer for the fifteenth annual Lebanese Food &amp; Cultural festival please<a href="/flyer.pdf"> click here</a>.</p>\r\n', '', 0, 0),
(96, 7, 15, 'guest', 'Directions', 'directions', 'public', 1363122031, NULL, 1363973076, NULL, 14, 'festival', '<h4>\r\n	Directions</h4>\r\n<h6>\r\n	Coming from South via Interstate 65</h6>\r\n<p>\r\n	Take Greensprings Ave. exit (#258) and proceed right to first stoplight. Turn left onto Greensprings Highway. Follow around to 2nd stoplight. Turn right onto 8th St. South. St. Elias will be on the right as you go under the I65 overpass.</p>\r\n<h6>\r\n	Coming from North via Interstate 65</h6>\r\n<p>\r\n	Take 6th Avenue South exit (#259A) and proceed right to first stoplight. Turn left onto 8th St. South. Proceed past 1 stoplight and under I65 overpass. St. Elias will be on the right.</p>\r\n<h6>\r\n	NEW EXPANDED PARKING</h6>\r\n<p>\r\n	We will have two offsite parking lots available for use Friday evening and all day and night Saturday. From UAB remote parking lot 1 - located at 608 8th Street South directly across University Boulevard next to the car dealership and from UAB parking lot 15R on 10th Avenue South next to the Epic School parking lot.</p>\r\n<p>\r\n	<img alt="" src="/modules/pages/images/festival_map.jpg" style="width: 463px; height: 232px;" /></p>\r\n<p>\r\n	<strong>Click the purple pin below to get driving directions</strong>.</p>\r\n<p>\r\n	<iframe frameborder="0" marginheight="0" marginwidth="0" scrolling="no" src="http://www.mapquest.com/embed?hk=PC2Zev" style="height: 270px; width: 450px;"></iframe></p>\r\n', '', 0, 0),
(99, 7, 15, 'guest', '5k Run', '5k-run', 'public', 1363970275, NULL, 1364227868, NULL, 14, 'festival', '<p>\r\n	For information about our Inaugural St. Elias Cedar 5K Run at 8:30 on Saturday, April 13 (i.e., Location, Route, Registration, Sponsorship, etc.) please<a href="http://register.dg-racing.net/search/event.aspx?id=19464"> </a><a href="http://register.dg-racing.net/search/event.aspx?id=19464">Click Here</a>.<br />\r\n	<br />\r\n	For access to our Facebook Page for our 5K Run please <a href="http://www.facebook.com/#%21/pages/The-St-Elias-Cedar-Run-5K/343307039102439">Click Here</a>.</p>\r\n', '', 0, 0);

